onClick:
__ht__function(event, data, view, point, width, height) {
if(!window.count){
    window.count = 1
}
let text = '···'
clearTimeout(window.a)
if(data.a('valueText')==='等待中'){
    data.a('valueText','充电中')
    data.a('visibility_2',true)
    window.a = setInterval((e)=>{
    window.count++
    value = text.substring(0,window.count)
    data.a('valuetext',value)
    if(window.count === 3){
        window.count = 0
    }
}, 500)
}else{
    data.a('visibility_2',false)
     data.a('valueText','等待中')
}
}
